import { useSelector } from "react-redux";
import "./cards.scss";

let Card = () => {
  let productsdetailed = useSelector((state) => state.productsdetailed);
  return (
    <>
      <div className="carddiv">
        {Object.values(productsdetailed).map((item, index) => (
          <div className="card">
            <div className="imagess">
              <img src={item.productImage[1]} />
            </div>
            <div className="price">
              <p>
                <b>{item.price}</b>
              </p>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default Card;
